        let postData = [
            {id:1, message:'Hi Lerill',like:10},
            {id:1, message:'sdlfkkhfshlkj', like:5}
        ];
        let dialogsPost = postData.map(post => <Post message={post.message} like={post.like}/>);
        return(
                <div>
                    <Profile />
                    <AddPost />
                    {dialogsPost}
                </div>

        );
        }
